import React, { useState } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import './myworks.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBell } from '@fortawesome/free-solid-svg-icons';

const myworks = (props) => {
